     QScriptValue REcmaSharedPointerUcs::destroy(QScriptContext *context, QScriptEngine *engine)
    
    {

        RUcs* self = getSelf("RUcs", context);
        //Q_ASSERT(self!=NULL);
        if (self==NULL) {
            return REcmaHelper::throwError("self is NULL", context);
        }
        
    
        delete self;
        context->thisObject().setData(engine->nullValue());
        context->thisObject().prototype().setData(engine->nullValue());
        context->thisObject().setPrototype(engine->nullValue());
        context->thisObject().setScriptClass(NULL);
        return engine->undefinedValue();
    }
    RUcs* REcmaSharedPointerUcs::getSelf(const QString& fName, QScriptContext* context)
    
        {
            RUcs* self = NULL;

            
                // self could be a normal object (e.g. from an UI file) or
                // an ECMA shell object (made from an ECMA script):
                //self = getSelfShell(fName, context);
                

            //if (self==NULL) {
                self = REcmaHelper::scriptValueTo<RUcsPointer >(context->thisObject())
                
                    ->data()
                
                ;
            //}

            if (self == NULL){
                // avoid recursion (toString is used by the backtrace):
                if (fName!="toString") {
                    REcmaHelper::throwError(QString("RUcs.%1(): "
                        "This object is not a RUcs").arg(fName),
                        context);
                }
                return NULL;
            }

            return self;
        }
        RUcs* REcmaSharedPointerUcs::getSelfShell(const QString& fName, QScriptContext* context)
    
        {
          RUcs* selfBase = getSelf(fName, context);
                RUcs* self = dynamic_cast<RUcs*>(selfBase);
                //return REcmaHelper::scriptValueTo<RUcs >(context->thisObject());
            if(self == NULL){
                REcmaHelper::throwError(QString("RUcs.%1(): "
                    "This object is not a RUcs").arg(fName),
                    context);
            }

            return self;
            


        }
